@EU_Commission @vonderleyen So, you're going to take peoples money and do useless nonsense with it?
It's about what I expected from you.
Dissolve the EU.

@EU_Commission @vonderleyen Just checking....
You do know that the E.U. Does not represent or have any control over the entire European Continent don’t you?

It’s an easy enough mistake to make, but you are actually just a political organisation representing the trade of countries that pay subscriptions.
